        Dictionary<string,long> dict = new Dictionary<string,long>();
        string[] words = test.Split(' ');
        for (int i = 0; i < words.Length; i++) {
            if (dict.ContainsKey(words[i])) {
                dict[words[i]]++;
            } else {
                dict.Add(words[i], 1L);
            }
        }
        return dict;

